import {BrowserRouter, Switch, Route} from 'react-router-dom'
import Presentation from './pages/Presentation';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Switch>
        <Route path="/" exact component={Presentation}/>
      </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
